import { createRouter, createWebHistory } from 'vue-router'
import ThresholdList from '../components/ThresholdList.vue' // 임계치 리스트 컴포넌트
import ThresholdRegister from '../components/ThresholdRegister.vue' // 임계치 등록 컴포넌트

const routes = [
  {
    path: '/',
    name: 'ThresholdList',
    component: ThresholdList // 기본 페이지로 설정
  },
  {
    path: '/register',
    name: 'ThresholdRegister',
    component: ThresholdRegister // 등록 페이지
  }
]

export default createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})
